package com.matao.bean;import java.io.Serializable;/** * @author: ZhouYang * @E-mail: ZhouYangGaoGao@163.com * @time:2015-5-5 下午5:04:52 * @Description:TODO */public class HeadAdList implements Serializable {	private int Id;	private String Title;	private String NativeName;	private String NativeParam;	private String ImgUrl;	private String Summary;	private String NickName;	private String NoticeContent;	private String NoticeContentNoticeContent;	private String HeadImage;		public String getSummary() {		return Summary;	}	public void setSummary(String summary) {		Summary = summary;	}	public String getTitle() {		return Title;	}	public int getId() {		return Id;	}	public void setId(int id) {		Id = id;	}	public String getNickName() {		return NickName;	}	public void setNickName(String nickName) {		NickName = nickName;	}	public String getNoticeContent() {		return NoticeContent;	}	public void setNoticeContent(String noticeContent) {		NoticeContent = noticeContent;	}	public String getNoticeContentNoticeContent() {		return NoticeContentNoticeContent;	}	public void setNoticeContentNoticeContent(String noticeContentNoticeContent) {		NoticeContentNoticeContent = noticeContentNoticeContent;	}	public String getHeadImage() {		return HeadImage;	}	public void setHeadImage(String headImage) {		HeadImage = headImage;	}	public void setTitle(String title) {		Title = title;	}	public String getNativeName() {		return NativeName;	}	public void setNativeName(String nativeName) {		NativeName = nativeName;	}	public String getNativeParam() {		return NativeParam;	}	public void setNativeParam(String nativeParam) {		NativeParam = nativeParam;	}	public String getImgUrl() {		return ImgUrl;	}	public void setImgUrl(String imgUrl) {		ImgUrl = imgUrl;	}	@Override	public String toString() {		return "HeadAdList [Id=" + Id + ", Title=" + Title + ", NativeName="				+ NativeName + ", NativeParam=" + NativeParam + ", ImgUrl="				+ ImgUrl + ", NickName=" + NickName + ", NoticeContent="				+ NoticeContent + ", NoticeContentNoticeContent="				+ NoticeContentNoticeContent + ", HeadImage=" + HeadImage + "]";	}}